INSERT INTO `mst_category_tes` VALUES (0,'WPT',10,'Wonderlic Test','1. Terdapat soal-soal dalam tes ini.\n2. Jawablah pertanyaan termudah untuk dikerjakan terlebih dahulu. \n3. Cara menjawab cukup menuliskan angka / huruf jika terdapat pilihan jawabannya - tanpa perlu menuliskan kalimat panjangnya.\n4. Kerjakan dengan tepat dan teliti.','2024-06-13 00:00:00',1,NULL,NULL),(1,'PAPI',10,'PAPI Kostick Test','1. Pilihlah salah satu dari pertanyaan yang tersedia di masing-masing soal yang paling menggambarkan kepribadian Anda.\r 2. Berikan jawaban di kanan tiap soal (kolom p).\r 3. Cara menjawab cukup menuliskan huruf Kiri atau Kanan.','2024-06-14 00:00:00',1,NULL,NULL),(2,'DISC',20,'DISC Test','Bayangkan anda berada dalam salah satu SETTING LINGKUNGAN kerja. Tugas anda, membaca 4 kalimat yang terdapat di dalam masing-masing kotak. Berikanlah tanda “X” disamping kalimat di kolom “P” untuk pernyataan yang PALING MENGGAMBARKAN diri anda dalam setting yang sudah ditentukan tersebut, kemudian berikanlah tanda “X” disamping kalimat di kolom “K” untuk pernyataan yang KURANG MENGGAMBARKAN diri anda dalam setting yang sudah ditentukan tersebut.  Untuk masing-masing kotak, hanya memilih satu respon PALING dan satu respon KURANG.','2024-06-14 00:00:00',1,NULL,NULL),(3,'ENG',10,'English Test','1. Terdapat soal-soal dalam tes ini.\n2. Jawablah pertanyaan termudah untuk dikerjakan terlebih dahulu. \n3. Cara menjawab cukup menuliskan huruf atas pilihan jawaban yang dimaksudkan.\n4. Kerjakan dengan tepat dan teliti.','2024-06-14 00:00:00',1,NULL,NULL);
