INSERT INTO `mtx_disc1` VALUES (1,'C','To the Point (langsung), cepat membuat keputusan, menyukai perubahan, menetapkan banyak sasaran, berani mengambil resiko, inovatif, kompetitif, efisien, menghargai waktu, memiliki inisiatif untuk memulai suatu aktifitas, memiliki prinsip (tidak mudah goyah)'),(1,'L','Kandidat memiliki tingkat ketegasan yang tinggi dan tingkat pengendalian yang tinggi (controlled). Ketegasan yang tinggi membuat subjek memiliki kepribadian D (Dominance) menjadi kurang sabar melihat hasil, dengan kata lain ingin cepat memperoleh hasil, dan hal ini menimbulkan perasaan akan kepentingan (sense of urgency) terhadap tugas yang membuat kandidat menjadi langsung (to the point) dan efisien (direct and efficient). Pengendalian diri yang kuat membuat menjadi bersikap individual, kurang terbuka kepada orang lain, namun hal ini menimbulkan motivasi diri yang kuat (self-motivated) dan lebih suka bekerja secara bebas (independent). Melihat sikap ybs seperti ini, orang lain akan cenderung memandang ybs sebagai seseorang yang tertutup, menuntut, suka bersaing dan ambisius. Subjek memiliki tipe kepribadian D (Dominance) akan lebih cocok untuk bekerja dalam suatu lingkungan yang memberikan kebebasan dan personal power, dimana hal ini akan membuat Subjek mampu menghadapi tantangan yang akan menimbulkan kreatifitas dan energi yang positif bagi kemajuan diri Subjek sebagai seorang profesional. Tipe D (Dominance) dapat diklarifikasikan sebagai : Developer Pattern, Result Oriented Pattern, Inspiration Pattern, and Creative Pattern'),(1,'M','Suka melawan(menentang, mendebat), selalu tergesa - gesa, cenderung melanggar peraturan, cenderung melampaui wewenang, tidak sabar dengan orang lain, kurang suka mendengar pendapat orang lain, mengambil alih banyak tugas, kurang taktis dan diplomasi, terlalu berfokus pada tugas, kurang memperhatikan hubungan dengan orang lain'),(2,'C','Cepat membuat keputusan, optimistik, kreatif dalam solusi masalah, memotifasi orang lain menuju sasaran,  memiliki rasa humor yang positif, senang bekerja sama dalam tim, mampu mengatasi konflik, pandai berbicara (menjual ide)'),(2,'L','Kandidat memiliki tingkat ketegasan yang tinggi dan tingkat keterbukaan yang tinggi. Tingkat keterbukaan yang tinggi membuat kandidat memiliki kepribadian I (Influence) menjadi lebih sosial, bersahabat, dapat menerima pendapat orang lain dan suka berkelompok. Sedangkan ketegasan yang tinggi membuat ybs menjadi antusias dalam melaksanakan tugas – tugas. Namun dalam kenyataan ybs lebih mementingkan hubungan positif dengan orang lain dibandingkan penyelesaian tugas–tugas. Tipe I (Influence) dapat diklarifikasikan sebagai : Promoter Pattern, Persuader Pattern, Counselor Pattern, and Appraiser Pattern.'),(2,'M','Impulsif (mengandalkan perasaan), tidak sistemetik, kurang mampu menetukan sasaran secara baik, terlalu mempercayai orang lain, tidak memperhatikan sampai ke hal terperinci (detail), cenderung memberikan delegasi secara berlebihan kepada orang lain, pendengar situasional (tergantung apakah dia tertarik atau tidak) '),(3,'C','Dapat dipercaya (diandalkan), bekerja keras untuk suatu alasan, pendengar yang ulung, sabar & empati, mampu mendamaikan orang yang berkonflik, senang bekerja sama dalam tim, logika dan seksama (teliti), mampu membangun dan membina hubungan jangka panjang dengan orang lain'),(3,'L','Kandidat memiliki tingkat penerimaan yang tinggi dan tingkat keterbukaan yang tinggi. Orang – orang yang memiliki tingkat penerimaan tinggi tidak menunjukan tingkat energi yang cukup untuk bersikap tegas, sehingga Subjek tampak kurang tegas, lebih sabar, mendatar, tidak menuntut dan tenang. Orang tipe S (Steadiness) tidak menyukai perubahan atau ketidakpastian, sehingga mereka merencanakan tindakan secara berhati–hati dan mendalam serta cenderung bekerja secara gigih dan terus menerus pada tugas–tugas yang telah ditetapkan oleh mereka. Meskipun orang–orang tipe S (Steadiness) tampak kurang percaya diri, namun mereka memiliki tingkat keterbukaan yang tinggi untuk menerima orang lain yang cenderung ditunjukan dalam keramah–tamahan dan kemurahan hati. Tipe S (Steadiness) dapat diklarifikasikan sebagai : Specialist Pattern, Achiever Pattern, Agent Pattern,Investigator Pattern.'),(3,'M','Tidak suka dikritik, cenderung tidak menyukai perubahan, kurang memiliki inisiatif untuk memulai aktivitas baru, terlalu mempercayai orang lain, cenderung tidak mampu menentukan prioritas, kurang teliti (kurang hati-hati)'),(4,'C','Berfikir objektif, hati-hati (teliti), mempertahankan standar tinggi, ketrampilan diplomatik,  memberikan perhatian sampai terperinci (detail), logika dan seksama (teliti), menyelesaikan masalah mengikuti langkah – langkah rasional (ilmiah)'),(4,'L','Kandidat memiliki tingkat penerimaan yang tinggi dan tingkat pengendalian yang tinggi (controlled). Orang–orang yang memiliki tingkat penerimaan tinggi tidak menunjukan tingkat energi yang cukup untuk bersikap tegas, sehingga ybs tampak kurang tegas dan bersikap reaktif. Namun tingkat pengendalian yang tinggi membuat ybs bersikap individual, kurang terbuka kepada orang lain, namun hal ini menimbulkan motivasi diri yang kuat (self-motivated) dan lebih suka bekerja secara bebas ( independent). Orang–orang tipe C (Compliance) cenderung melihat kehidupan dalam bentuk struktur dan peraturan–peraturan dan berusaha untuk mencapai keakuratan dan ketelitian setinggi mungkin. Berdasarkan hal ini maka mereka menjadi lebih berhati – hati dan menjadi sangat sensitif terhadap perubahan dan hal – hal baru. Tipe C (Compliance) dapat diklarifikasikan sebagai : Objective thinker Pattern, Perfectionist Pattern, and Practitioner Pattern.'),(4,'M','Ragu-ragu dalam bertindak, cenderung rewel (mempermasalahkan sampai hal-hal detail), cenderung bersikap bertahan (defensif) bila dikritik, cenderung hanya memberikan instruksi tanpa berusaha menjelaskannya');
/*!40000 ALTER TABLE `mtx_disc1` ENABLE KEYS */;
UNLOCK TABLES;

